import React from "react";
import GoogleMapReact from "google-map-react";

const Map = () => {
  const apiKey = "AIzaSyBwwRjHA3A4j64wjjtRgKfhviBkvz9psYE";

  const coordinates = { lat: 5.301046242896597, lng: -3.9488406969010037 };
  return (
    <div
      style={{
        height: "100vh",
      }}
    >
      <p>Map</p>
      <GoogleMapReact
        bootstrapURLKeys={{ key: "AIzaSyBwwRjHA3A4j64wjjtRgKfhviBkvz9psYE" }}
        defaultCenter={coordinates}
        center={coordinates}
        defaultZoom={14}
        margin={[50, 50, 50, 50]}
        option={''}
        onClick={''}
      ></GoogleMapReact>
    </div>
  );
};

export default Map;
